import React, {Component} from 'react';
import './Nav.css';
export default class Nav extends Component {
    render() {
      return(
        <div className="Nav">
          <div className="Nav-category-tab">category</div>
          <ul className="Nav-category-items">
            <li><a href="/category1">category1</a></li>
            <li><a href="/category2">category2</a></li>
            <li lassName="Nav-category-foot"><a href="/category2">foot</a></li>
          </ul>
        </div>
      )
    }
  }
